import { IconButton } from "@material-ui/core";
import React from "react";
import "./Presentation.css";

function Presentation(props) {
  return (
    <div className="all">
      <div className="demodiv">
        <div className="demo">
          My name is Nha Vy, everybody CALL ME ...0695821092.
        </div>
      </div>
      <div className="bodylist">
            <p className="skills">Skills</p>
            <ul className="content_container_list">
              <li className="list_item">HTML JS React Node MySQL CSS Material UI Tailwind Agile's method Terminal Git github</li>
              <li className="list_item">& SO MUCH MORE</li>
            </ul>


      </div>
      {/* <img src="./me.png" alt="about-me" className="me" /> */}
      <IconButton href="https://github.com/navyrandom">
        <img src="./github.png" alt="linkgithub" className="github" />
      </IconButton>
      <IconButton href="https://www.linkedin.com/in/nha-vy-vo-doan-94817765/">
        <img src="./linkedin.png" alt="link-linkedin" className="linkedin" />
      </IconButton>
    </div>
  );
}

export default Presentation;
